// import React from "react";



import React, { PureComponent } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import 'leaflet/dist/leaflet.css';

// import LeafletMap from './components/app/map';
// import Header from './components/app/header';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

import Footer from './components/app/footer';
import Home from "./components/app/home/index";
import Login from "./components/app/signup/login";
import Register from "./components/app/signup/register";
import SideNav from './components/app/sidebar/sidenav.js';
import MainHeader from "./components/app/headers/mainheader";
import LoggedHeader from "./components/app/headers/loggedheader";
import CardView from "./components/app/mapview/cardview";
import Profile from "./components/app/userprofile/userprofile";
import Header from "./components/app/headers";
import AddAttractions from "./components/app/userprofile/addattractions";
import Blog from "./components/app/Details/Blog";
import Blog2 from "./components/app/Details/Blog2";
import UpdateAttractions from "./components/app/userprofile/updateattraction"


class App extends PureComponent {
  state = {
    markers: [],
  };

  setMarker = ({latitude, longitude}) => {
    this.setState({
      markers: [...this.state.markers, {
        latitude,
        longitude 
      }]
    })
  }

  render() {
    console.log(this.state)
    return (

        <Router>
                <div className = "App">

                    <Route exact path="/header" component={Header} />
                    <Route exact path="/" component={Home} />
                    <Route exact path="/login" component={Login} />
                   <Route exact path="/signup" component={Register} />
                   <Route exact path="/sidenav" component={SideNav} />
                   <Route exact path="/cardview" component={CardView} /> 
                   <Route exact path="/lh" component={LoggedHeader}/>
                   <Route exact path="/mh" component={MainHeader}/>                
                   <Route exact path="/profile" component={Profile} />
                   <Route exact path="/blog" component={Blog} />
                   <Route exact path="/blog2" component={Blog2} />
                   <Route exact path="/addattr" component={AddAttractions} />
                   <Route exact path="/editattr" component={UpdateAttractions} />

                   {/* <div className="App"style={{textAlign: "left"}}>
        <Header setMarker={this.setMarker} />
        <LeafletMap markers={this.state.markers} setMarker={this.setMarker} />
      </div> */}


                <Footer/>               
             </div>

        </Router>

    );
  }
}

export default App;
